import React from 'react';
var name;
var number;
var expMonth;
var expYear;
var cvc;

const SetCardInfo = (passedName, passedNumber) => {
    name = passedName;
    number = passedNumber;
}

const SetCardInfoMonth = (passedExpMonth) => {
    expMonth = passedExpMonth;
}

const SetCardInfoYear = (passedExpYear) => {
    expYear = passedExpYear;
}

const SetCardInfoCVC = (passedCVC) => {
    cvc = passedCVC;
}

export default {
    SetCardInfoName, 
    SetCardInfoNumber, 
    SetCardInfoMonth, 
    SetCardInfoYear, 
    SetCardInfoCVC,
};
